;; gorilla-repl.fileformat = 1

;; **
;;; # Network Inter-contact time
;;; This worksheet examines the inter-contact time by studying the distribution and density curve for each label, as well as overall statistics and evolution of the average over the observation period.
;; **

;; @@
(ns stunning-pine
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.table :as table]
            [gg4clj.core :as gg4clj]
            [ceres-analytics.measures :refer [inter-contact-time]]
             [ceres-analytics.helpers :refer [element-color element-name contacts cascades nodes table-columns format-to-table-view t0 tmax]]
            [incanter.stats :as stats]
            [incanter.core :as incntr]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Statistics
;; **

;; @@
(table/table-view 
  (map (fn [[k v]]
         (concat [(element-name k)] (format-to-table-view v))) 
       (zipmap contacts 
               (map (fn [c] 
                      (inter-contact-time c t0 tmax :statistics)) 
                    contacts) )) 
  :columns table-columns)
