;; **
;;; ## Distributions
;; **

;; @@

(defn plot-icts-dist [coll]
  (let [dat {:icts (map incntr/log10 (remove #{0} (inter-contact-time coll t0 tmax :distribution)))}]
    (gg4clj/view
      [[:library "scales"]
        [:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :icts]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.25 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         [:xlab "in 10^x Seconds"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Inter-contact histogram of " coll)])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stunning-pine/plot-icts-dist</span>","value":"#'stunning-pine/plot-icts-dist"}
;; <=

;; @@
(for [c contacts]
  (plot-icts-dist c))
;; @@

;; **
;;; # Average evolution
;; **

;; @@
(defn plot-ict-evolution [coll]
(let [curr (map :mean (inter-contact-time coll t0 tmax :evolution))
       dat {:ltncs curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :ltncs]]
         [:geom_line {:color "#999999"}]
         [:xlab "Day"]
         [:ylab "Seconds"]
         [:theme_bw]
         [:ggtitle (str "Average inter-contact time evolution of " coll)])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stunning-pine/plot-ict-evolution</span>","value":"#'stunning-pine/plot-ict-evolution"}
;; <=

;; @@
(for [c contacts]
  (plot-ict-evolution c))
